INSERT INTO `blog` VALUES ('15','Frontend Developer: İş Tanımı, Beceriler ve Kariyer Yolu','<p>Teknolojik gelişmelerin hızla ilerlediği günümüzde, web siteleri ve uygulamaları kullanıcıların deneyimlerini iyileştirmek için vazgeçilmez hale gelmiştir. İşte burada devreye giren Frontend Developerlar, kullanıcıların etkileşimde bulunduğu ön uç yani','5483080_2842680.jpg','frontend-developer-is-tanimi-beceriler-ve-kariyer-yolu','frontend yol haritası, yazılıma nerden başlanmalı,','2023-07-17 23:30:55');
INSERT INTO `blog` VALUES ('16','Backend Developer: İş Tanımı, Beceriler ve Kariyer Yolu','<p>Teknolojinin hızla gelişmesiyle birlikte, web siteleri ve uygulamaların arkasında yer alan sistemler ve veritabanları da büyük bir önem kazanmıştır. İşte burada devreye giren Backend Developerlar, web sitelerinin ve uygulamalarının arka planında çalışa','18407473_5995345.jpg','backend-developer-is-tanimi-beceriler-ve-kariyer-yolu','backend developer nasıl olunur','2023-07-17 23:31:50');
INSERT INTO `blog` VALUES ('20','Full Stack Developer Nasıl Ounur Kariyer Yolu Nasıl Olmalı','<p>Teknolojinin hızla gelişmesiyle birlikte, web geliştirme alanında tam donanımlı ve çok yönlü profesyoneller olan Full Stack Developerlar büyük bir önem kazanmıştır. Bir Full Stack Developer, hem Frontend (ön uç) hem de Backend (arka uç) teknolojilerine','5097619.jpg','full-stack-developer-nasil-ounur-kariyer-yolu-nasil-olmali','Full Stack Developer Nasıl Olunur, Full Stack Developer Kariyer Yolu Nasıl Olmal','2023-07-18 12:27:06');
INSERT INTO `blog` VALUES ('22',' Kurumsal Web Tasarım Sitesi Nasıl Kurulur','<p>Günümüzde işletmeler için çevrimiçi varlıklarının önemi giderek artmaktadır. Kurumsal web siteleri, işletmelerin dijital dünyada var olmaları ve potansiyel müşterilere erişmeleri için kritik bir öneme sahiptir. Kurumsal web tasarımı, işletmelerin kimli','11669400_20945431.jpg','kurumsal-web-tasarim-sitesi-nasil-kurulur',' Kurumsal Web Tasarım Sitesi Nasıl Kurulur','2023-07-18 12:31:43');
INSERT INTO `blog` VALUES ('55','Jquery Ajax Kod Örnegi','&lt;div style=&quot;background-color:#2b2b2b;color:#a9b7c6;font-family:&#039;JetBrains Mono&#039;,monospace;font-size:9,0pt;white-space:pre;&quot;&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;let  &lt;/span&gt;fs = document.querySelectorAll(&lt;span style=&quot;color:#6a8759;&quot;&gt;&quot;.fs-15&quot;&lt;/span&gt;)&lt;span style=&quot;color:#cc7832;&quot;&gt;;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;let &lt;/span&gt;date = []&lt;span style=&quot;color:#cc7832;&quot;&gt;;&lt;br&gt;&lt;/span&gt;fs.forEach((e)=&gt;{&lt;br&gt;    &lt;span style=&quot;color:#cc7832;&quot;&gt;if&lt;/span&gt;(e.checked){&lt;br&gt;        date.push(e.value)&lt;span style=&quot;color:#cc7832;&quot;&gt;;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;    &lt;/span&gt;}&lt;br&gt;})&lt;br&gt;&lt;br&gt;$.ajax({&lt;br&gt;    url: &lt;span style=&quot;color:#6a8759;&quot;&gt;&quot;/removeAllData&quot;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;    &lt;/span&gt;type: &lt;span style=&quot;color:#6a8759;&quot;&gt;&quot;POST&quot;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;    &lt;/span&gt;data: { tablo: tablo&lt;span style=&quot;color:#cc7832;&quot;&gt;, &lt;/span&gt;row: date&lt;span style=&quot;color:#cc7832;&quot;&gt;, &lt;/span&gt;removeAllData: &lt;span style=&quot;color:#6a8759;&quot;&gt;&#039;removeAllData&#039; &lt;/span&gt;}&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;    &lt;/span&gt;success: &lt;span style=&quot;color:#cc7832;&quot;&gt;function &lt;/span&gt;(data) {&lt;br&gt;&lt;br&gt;        &lt;span style=&quot;color:#cc7832;&quot;&gt;if&lt;/span&gt;(data==&lt;span style=&quot;color:#6897bb;&quot;&gt;1&lt;/span&gt;){&lt;br&gt;            Swal.fire({&lt;br&gt;                position: &lt;span style=&quot;color:#6a8759;&quot;&gt;&#039;top-center&#039;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;icon: &lt;span style=&quot;color:#6a8759;&quot;&gt;&#039;success&#039;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;title: &lt;span style=&quot;color:#6a8759;&quot;&gt;&quot;Kayıtlar Başarılı Şekilde Silinmiştir...&quot;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;showConfirmButton: &lt;span style=&quot;color:#cc7832;&quot;&gt;false,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;timer: &lt;span style=&quot;color:#6897bb;&quot;&gt;1000&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#6897bb;&quot;&gt;            &lt;/span&gt;})&lt;br&gt;            setInterval(() =&gt; { window.location.reload() }&lt;span style=&quot;color:#cc7832;&quot;&gt;, &lt;/span&gt;&lt;span style=&quot;color:#6897bb;&quot;&gt;1500&lt;/span&gt;)&lt;span style=&quot;color:#cc7832;&quot;&gt;;&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;        &lt;/span&gt;}&lt;span style=&quot;color:#cc7832;&quot;&gt;else if&lt;/span&gt;(data==&lt;span style=&quot;color:#6897bb;&quot;&gt;2&lt;/span&gt;){&lt;br&gt;            Swal.fire({&lt;br&gt;                position: &lt;span style=&quot;color:#6a8759;&quot;&gt;&#039;top-center&#039;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;icon: &lt;span style=&quot;color:#6a8759;&quot;&gt;&#039;error&#039;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;title: &lt;span style=&quot;color:#6a8759;&quot;&gt;&quot;Lütfen Veri Seciniz...&quot;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;showConfirmButton: &lt;span style=&quot;color:#cc7832;&quot;&gt;false,&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#cc7832;&quot;&gt;                &lt;/span&gt;timer: &lt;span style=&quot;color:#6897bb;&quot;&gt;1000&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;color:#6897bb;&quot;&gt;            &lt;/span&gt;})&lt;br&gt;&lt;br&gt;        }&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;    }&lt;br&gt;})&lt;span style=&quot;color:#cc7832;&quot;&gt;;&lt;/span&gt;&lt;/div&gt;','maxresdefault.jpg','jquery-ajax-kod-ornegi','yazilim,blog,ceo,sibergüvenlik','2023-07-23 23:19:03');
INSERT INTO `blog` VALUES ('56','CEO Optimizasyonu Nedir','&lt;h2 style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; list-style: none; border: 0px; outline: none; line-height: 1.4; font-weight: 600; font-size: 27px; color: rgb(44, 47, 52); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; list-style: none; border: 0px; outline: none;&quot;&gt;SEO (Arama Motoru Optimizasyonu) Nedir?&lt;/span&gt;&lt;span class=&quot;ez-toc-section-end&quot; style=&quot;padding: 0px; margin: 0px; list-style: none; border: 0px; outline: none;&quot;&gt;&lt;/span&gt;&lt;/h2&gt;&lt;p style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; list-style: none; border: 0px; outline: none; line-height: 26px; color: rgb(44, 47, 52); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif; font-size: 15px;&quot;&gt;SEO, ücretli olmayan (“organik” olarak bilinir), arama motoru sonuçları aracılığıyla web sitenizin ziyaretçilerini artırma çalışmalarıdır.&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; list-style: none; border: 0px; outline: none; line-height: 26px; color: rgb(44, 47, 52); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif; font-size: 15px;&quot;&gt;Başka bir ifade ile:&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; list-style: none; border: 0px; outline: none; line-height: 26px; color: rgb(44, 47, 52); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif; font-size: 15px;&quot;&gt;Web sitelerinin arama motorlarında daha iyi performans göstermesi için yapılan çalışmaların tümüne verilen isimdir.&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; list-style: none; border: 0px; outline: none; line-height: 26px; color: rgb(44, 47, 52); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif; font-size: 15px;&quot;&gt;&lt;span style=&quot;padding: 0px; margin: 0px; list-style: none; border: 0px; outline: none; font-weight: 600;&quot;&gt;SEO&lt;/span&gt;, ingilizce karşılığı Search Engine Optimization olan kelimelerin kısaltılmış biçimidir. Amaç web sitelerinin arama motoru sonuç sayfasında (&lt;span style=&quot;padding: 0px; margin: 0px; list-style: none; border: 0px; outline: none; font-weight: 600;&quot;&gt;SERP&lt;/span&gt;) daha iyi sıralamalar elde etmesidir.&lt;/p&gt;&lt;p style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 25px; margin-left: 0px; list-style: none; border: 0px; outline: none; line-height: 26px; color: rgb(44, 47, 52); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif; font-size: 15px;&quot;&gt;SEO sayesinde web sitenizin performansını artırabilir daha fazla ziyaretçiye ulaşabilirsiniz.&lt;/p&gt;&lt;div class=&quot;box note &quot; style=&quot;padding: 20px; margin: 0px 0px 20px; list-style: none; border: 0px rgb(233, 229, 158); outline: none; clear: both; background: rgb(255, 253, 219); overflow-wrap: break-word; text-shadow: rgb(255, 255, 255) 0px 1px 1px; color: rgb(117, 111, 0); font-family: -apple-system, BlinkMacSystemFont, &amp;quot;Segoe UI&amp;quot;, Roboto, Oxygen, Oxygen-Sans, Ubuntu, Cantarell, &amp;quot;Helvetica Neue&amp;quot;, &amp;quot;Open Sans&amp;quot;, Arial, sans-serif; font-size: 15px;&quot;&gt;&lt;div class=&quot;box-inner-block&quot; style=&quot;padding: 0px 0px 0px 50px; margin: 0px; list-style: none; border: 0px; outline: none; min-height: 30px;&quot;&gt;&lt;svg class=&quot;svg-inline--fa tie-shortcode-boxicon&quot; style=&quot;padding: 0px; margin: 0px 0px 0px -50px; list-style: none; border: 0px; outline: none; display: inline-block; font-family: &amp;quot;Font Awesome 5 Free&amp;quot;; font-weight: 900; float: left; width: 40px; text-align: center;&quot; aria-hidden=&quot;true&quot; focusable=&quot;false&quot; data-prefix=&quot;fas&quot; data-icon=&quot;null&quot; role=&quot;img&quot; xmlns=&quot;http://www.w3.org/2000/svg&quot; viewBox=&quot;0 0 512 512&quot; data-fa-i2svg=&quot;&quot;&gt;&lt;undefined&gt;&lt;/undefined&gt;&lt;/svg&gt;&lt;!-- &lt;span class=&quot;fa tie-shortcode-boxicon&quot; style=&quot;padding: 0px; margin: 0px 0px 0px -50px; list-style: none; border: 0px; outline: none; display: inline-block; font-family: &amp;quot;Font Awesome 5 Free&amp;quot;; font-weight: 900; float: left; width: 40px; text-align: center;&quot;&gt;&lt;/span&gt; Font Awesome fontawesome.com --&gt;Bu içerik sayesinde&amp;nbsp;&lt;span style=&quot;padding: 0px; margin: 0px; list-style: none; border: 0px; outline: none; font-weight: 600;&quot;&gt;SEO Nedir?&amp;nbsp;&lt;/span&gt;sorusunun cevabını ve Arama Motoru Optimizasyonunun nasıl yapıldığıyla alakalı bilgileri öğreneceksiniz. Ayrıca içerik sonrasında aklınıza takılan tüm sık sorulan sorulara hızlı cevaplar alabileceksiniz. İçeriğin uzun olması sizi korkutmasın, okurken keyif alacaksınız.&lt;/div&gt;&lt;/div&gt;&lt;h2 style=&quot;padding: 0px; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; list-style: 